subproject.description:
Output1: conservation and sustainable use management capacities at four existing MPAs are strengthened;
Output 2: tools, instruments and approaches for addressing the root causes of critical threats to marine biodiversity in China’s South Sea coastal area are developed, tested and demonstrated;
Output 3: appropriate tools for conservation and sustainable use at the six sites and promote their broader adaptation across China’s South Sea coastal area are implemented.

